import React from 'react';
import ReactDOM from 'react-dom/client';
import { useState } from 'react';

//Output Kubsu logo, but after 2 sec see UserForm
export default function ClientKubsu() {

    const [label, setLabel] = useState('wfefwewef')

    const ClickButton = ()=> {
        const click = true
        if (click) {
            setLabel("ClickButton")
        } else {
            setLabel("AgainClick")
        }
        

    }

    return <>
        <div>
            <h1>{label}</h1>
            <button onClick={ClickButton}>Change</button>
        </div>
    
    </>
}
